import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App container-fluid">
      <Row>
        <Col className="p-5 heightFull align-items-center" md={5}>
          <h1 className="font-weight-bold display-4">Chazzy</h1>
          <form>
            <input className="form-control border border-0 shadow" placeholder="@username" />
            <input placeholder="password" />
          </form>
        </Col>
        <Col className="p-5 heightFull align-items-center" md={7}>
          <h4>Chazzy</h4>
        </Col>
      </Row>
    </div>
  );
}

export default App;
